[{"location":"examples/economic_dispatch/","page":"Economic dispatch","title":"Economic dispatch","text":"begin\n    using AustralianElectricityMarkets\n    using PowerSimulations\n    using PowerSystems\n\n    using Chain\n    using DataFrames\n    using AlgebraOfGraphics, CairoMakie\n    using TidierDB\n    using Dates\n    using HiGHS\nend","category":"section"},{"location":"examples/economic_dispatch/#Setup-the-system","page":"Economic dispatch","title":"Setup the system","text":"Initialise a connection to manage the market data via duckdb\n\nnote: Get the data first!\nYou will first need to download the data from the monthly archive, saving them locally in parquet files.fetch_table_data(date_range, RegionalNetworkConfiguration())Only the data requirements for a RegionalNetworkconfiguration are downloaded.\n\ndb = connect(duckdb());\n\nInstantiate the system\n\nsys = nem_system(db, RegionalNetworkConfiguration())\n\n<table>\n  <caption style = \"text-align: left;\">System</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Property</th>\n      <th style = \"text-align: left;\">Value</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">Name</td>\n      <td style = \"text-align: left;\"></td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Description</td>\n      <td style = \"text-align: left;\"></td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">System Units Base</td>\n      <td style = \"text-align: left;\">SYSTEM_BASE</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Base Power</td>\n      <td style = \"text-align: left;\">100.0</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Base Frequency</td>\n      <td style = \"text-align: left;\">60.0</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Num Components</td>\n      <td style = \"text-align: left;\">471</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">Static Components</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Type</th>\n      <th style = \"text-align: left;\">Count</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">ACBus</td>\n      <td style = \"text-align: left;\">12</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Arc</td>\n      <td style = \"text-align: left;\">12</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Area</td>\n      <td style = \"text-align: left;\">6</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Line</td>\n      <td style = \"text-align: left;\">14</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerLoad</td>\n      <td style = \"text-align: left;\">6</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">RenewableDispatch</td>\n      <td style = \"text-align: left;\">222</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">ThermalStandard</td>\n      <td style = \"text-align: left;\">199</td>\n    </tr>\n  </tbody>\n</table>\n\n\n\nSet the horizon to consider for the simulation\n\ndate_range = Date(2025, 1, 1):Date(2025, 1, 2)\ninterval = Minute(30)\nhorizon = Hour(24)\n\n24 hours\n\nSet deterministic timseries\n\nset_demand!(sys, db, date_range; resolution = interval)\nset_renewable_pv!(sys, db, date_range; resolution = interval)\nset_renewable_wind!(sys, db, date_range; resolution = interval)\n\n[ Info: Setting loads to 0 for SNOWY1 Load\n[ Info: Setting PV power time series\n[ Info: Setting wind power time series\n\n\nDerive forecasts from the deterministic timseries\n\ntransform_single_time_series!(\n    sys,\n    horizon, # horizon\n    interval, # interval\n);\n\n@show sys\n\n<table>\n  <caption style = \"text-align: left;\">System</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Property</th>\n      <th style = \"text-align: left;\">Value</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">Name</td>\n      <td style = \"text-align: left;\"></td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Description</td>\n      <td style = \"text-align: left;\"></td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">System Units Base</td>\n      <td style = \"text-align: left;\">SYSTEM_BASE</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Base Power</td>\n      <td style = \"text-align: left;\">100.0</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Base Frequency</td>\n      <td style = \"text-align: left;\">60.0</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Num Components</td>\n      <td style = \"text-align: left;\">471</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">Static Components</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Type</th>\n      <th style = \"text-align: left;\">Count</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">ACBus</td>\n      <td style = \"text-align: left;\">12</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Arc</td>\n      <td style = \"text-align: left;\">12</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Area</td>\n      <td style = \"text-align: left;\">6</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Line</td>\n      <td style = \"text-align: left;\">14</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerLoad</td>\n      <td style = \"text-align: left;\">6</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">RenewableDispatch</td>\n      <td style = \"text-align: left;\">222</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">ThermalStandard</td>\n      <td style = \"text-align: left;\">199</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">StaticTimeSeries Summary</caption>\n  <thead>\n    <tr class = \"header\">\n      <th style = \"text-align: left;\">owner_type</th>\n      <th style = \"text-align: left;\">owner_category</th>\n      <th style = \"text-align: left;\">time_series_type</th>\n      <th style = \"text-align: left;\">initial_timestamp</th>\n      <th style = \"text-align: left;\">resolution</th>\n      <th style = \"text-align: left;\">count</th>\n      <th style = \"text-align: left;\">time_step_count</th>\n    </tr>\n    <tr class = \"subheader headerLastRow\">\n      <th style = \"text-align: left;\">String</th>\n      <th style = \"text-align: left;\">String</th>\n      <th style = \"text-align: left;\">String</th>\n      <th style = \"text-align: left;\">String</th>\n      <th style = \"text-align: left;\">Dates.CompoundPeriod</th>\n      <th style = \"text-align: left;\">Int64</th>\n      <th style = \"text-align: left;\">Int64</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">PowerLoad</td>\n      <td style = \"text-align: left;\">Component</td>\n      <td style = \"text-align: left;\">SingleTimeSeries</td>\n      <td style = \"text-align: left;\">2025-01-01T00:00:00</td>\n      <td style = \"text-align: left;\">30 minutes</td>\n      <td style = \"text-align: left;\">6</td>\n      <td style = \"text-align: left;\">48</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">RenewableDispatch</td>\n      <td style = \"text-align: left;\">Component</td>\n      <td style = \"text-align: left;\">SingleTimeSeries</td>\n      <td style = \"text-align: left;\">2025-01-01T00:00:00</td>\n      <td style = \"text-align: left;\">30 minutes</td>\n      <td style = \"text-align: left;\">222</td>\n      <td style = \"text-align: left;\">48</td>\n    </tr>\n  </tbody>\n</table>\n<table>\n  <caption style = \"text-align: left;\">Forecast Summary</caption>\n  <thead>\n    <tr class = \"header\">\n      <th style = \"text-align: left;\">owner_type</th>\n      <th style = \"text-align: left;\">owner_category</th>\n      <th style = \"text-align: left;\">time_series_type</th>\n      <th style = \"text-align: left;\">initial_timestamp</th>\n      <th style = \"text-align: left;\">resolution</th>\n      <th style = \"text-align: left;\">count</th>\n      <th style = \"text-align: left;\">horizon</th>\n      <th style = \"text-align: left;\">interval</th>\n      <th style = \"text-align: left;\">window_count</th>\n    </tr>\n    <tr class = \"subheader headerLastRow\">\n      <th style = \"text-align: left;\">String</th>\n      <th style = \"text-align: left;\">String</th>\n      <th style = \"text-align: left;\">String</th>\n      <th style = \"text-align: left;\">String</th>\n      <th style = \"text-align: left;\">Dates.CompoundPeriod</th>\n      <th style = \"text-align: left;\">Int64</th>\n      <th style = \"text-align: left;\">Dates.CompoundPeriod</th>\n      <th style = \"text-align: left;\">Dates.CompoundPeriod</th>\n      <th style = \"text-align: left;\">Int64</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">PowerLoad</td>\n      <td style = \"text-align: left;\">Component</td>\n      <td style = \"text-align: left;\">DeterministicSingleTimeSeries</td>\n      <td style = \"text-align: left;\">2025-01-01T00:00:00</td>\n      <td style = \"text-align: left;\">30 minutes</td>\n      <td style = \"text-align: left;\">6</td>\n      <td style = \"text-align: left;\">1 day</td>\n      <td style = \"text-align: left;\">30 minutes</td>\n      <td style = \"text-align: left;\">1</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">RenewableDispatch</td>\n      <td style = \"text-align: left;\">Component</td>\n      <td style = \"text-align: left;\">DeterministicSingleTimeSeries</td>\n      <td style = \"text-align: left;\">2025-01-01T00:00:00</td>\n      <td style = \"text-align: left;\">30 minutes</td>\n      <td style = \"text-align: left;\">222</td>\n      <td style = \"text-align: left;\">1 day</td>\n      <td style = \"text-align: left;\">30 minutes</td>\n      <td style = \"text-align: left;\">1</td>\n    </tr>\n  </tbody>\n</table>\n","category":"section"},{"location":"examples/economic_dispatch/#Economic-dispatch","page":"Economic dispatch","title":"Economic dispatch","text":"PowerSimulation.jl provides different utilities to simulate an electricity system.\n\nThe following section demonstrates the definition of an economic dispatch problem, where all units in the NEM need to to be dispatched at the lowest cost to meet the aggregate demand at each region.\n\ntemplate = template_economic_dispatch()\n\n<table>\n  <caption style = \"text-align: left;\">Network Model</caption>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">Network Model</td>\n      <td style = \"text-align: left;\">PowerSimulations.CopperPlatePowerModel</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Slacks</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PTDF</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Duals</td>\n      <td style = \"text-align: left;\">None</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">Device Models</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Device Type</th>\n      <th style = \"text-align: left;\">Formulation</th>\n      <th style = \"text-align: left;\">Slacks</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.ThermalStandard</td>\n      <td style = \"text-align: left;\">PowerSimulations.ThermalBasicDispatch</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.RenewableDispatch</td>\n      <td style = \"text-align: left;\">PowerSimulations.RenewableFullDispatch</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.PowerLoad</td>\n      <td style = \"text-align: left;\">PowerSimulations.StaticPowerLoad</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.RenewableNonDispatch</td>\n      <td style = \"text-align: left;\">PowerSimulations.FixedOutput</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.InterruptiblePowerLoad</td>\n      <td style = \"text-align: left;\">PowerSimulations.PowerLoadInterruption</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">Branch Models</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Branch Type</th>\n      <th style = \"text-align: left;\">Formulation</th>\n      <th style = \"text-align: left;\">Slacks</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.Transformer2W</td>\n      <td style = \"text-align: left;\">PowerSimulations.StaticBranch</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.Line</td>\n      <td style = \"text-align: left;\">PowerSimulations.StaticBranch</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.TwoTerminalHVDCLine</td>\n      <td style = \"text-align: left;\">PowerSimulations.HVDCTwoTerminalDispatch</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.TapTransformer</td>\n      <td style = \"text-align: left;\">PowerSimulations.StaticBranch</td>\n      <td style = \"text-align: left;\">false</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">Service Models</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Service Type</th>\n      <th style = \"text-align: left;\">Formulation</th>\n      <th style = \"text-align: left;\">Slacks</th>\n      <th style = \"text-align: left;\">Aggregated Model</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.VariableReserve{PowerSystems.ReserveUp}</td>\n      <td style = \"text-align: left;\">PowerSimulations.RangeReserve</td>\n      <td style = \"text-align: left;\">false</td>\n      <td style = \"text-align: left;\">true</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerSystems.VariableReserve{PowerSystems.ReserveDown}</td>\n      <td style = \"text-align: left;\">PowerSimulations.RangeReserve</td>\n      <td style = \"text-align: left;\">false</td>\n      <td style = \"text-align: left;\">true</td>\n    </tr>\n  </tbody>\n</table>\n\n\nThe Economic Dispatch problem will be solved with open source solver HiGHS, and a relatively large mip gap for the purposes of this example.\n\nsolver = optimizer_with_attributes(HiGHS.Optimizer, \"mip_rel_gap\" => 0.05)\n\n\nproblem = DecisionModel(template, sys; optimizer = solver, horizon = horizon)\nbuild!(problem; output_dir = joinpath(pwd(), \"out\"))\n\nInfrastructureSystems.Optimization.ModelBuildStatusModule.ModelBuildStatus.BUILT = 0\n\nSolve the problem\n\nsolve!(problem)\n\nInfrastructureSystems.Simulation.RunStatusModule.RunStatus.SUCCESSFULLY_FINALIZED = 0\n\nObserve the results\n\nres = OptimizationProblemResults(problem)\n\n<p> Start: 2025-01-01T00:00:00</p>\n<p> End: 2025-01-01T23:30:00</p>\n<p> Resolution: 30 minutes</p>\n\n<table>\n  <caption style = \"text-align: left;\">PowerSimulations Problem Expressions Results</caption>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">ActivePowerBalance__System</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">FuelConsumptionExpression__ThermalStandard</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">ProductionCostExpression__RenewableDispatch</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">ProductionCostExpression__ThermalStandard</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">PowerSimulations Problem Parameters Results</caption>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">ActivePowerTimeSeriesParameter__RenewableDispatch</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">ActivePowerTimeSeriesParameter__PowerLoad</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">PowerSimulations Problem Variables Results</caption>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">ActivePowerVariable__ThermalStandard</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">ActivePowerVariable__RenewableDispatch</td>\n    </tr>\n  </tbody>\n</table>\n\n\nLets observe how the units are dispatched\n\nbegin\n    renewables = read_variable(res, \"ActivePowerVariable__RenewableDispatch\")\n    thermal = read_variable(res, \"ActivePowerVariable__ThermalStandard\")\n    gens = innerjoin(renewables, thermal, on = :DateTime)\n    gens_long = stack(gens, Not([:DateTime]))\n\n\n    by_fuel = @chain select(\n        read_units(db),\n        [:DUID, :STATIONID, :CO2E_ENERGY_SOURCE, :REGIONID]\n    ) begin\n        rightjoin(gens_long, on = :DUID => :variable)\n        groupby([:CO2E_ENERGY_SOURCE, :REGIONID, :DateTime])\n        combine(:value => sum => :value)\n        subset(:value => ByRow(>(0.0)))\n        dropmissing!\n        select!(\n            :DateTime, :REGIONID, :CO2E_ENERGY_SOURCE => :Source,\n            :value\n        )\n    end\n\n\n    loads = @chain res begin\n        read_parameter(\"ActivePowerTimeSeriesParameter__PowerLoad\")\n        select(Not(\"SNOWY1 Load\"))\n        stack()\n        transform!(\n            :variable => ByRow(x -> split(x, \" \")[1]) => :REGIONID\n        )\n        insertcols!(\n            :Source => \"Region demand\"\n        )\n        select!(\n            :DateTime, :REGIONID, :Source,\n            :value => ByRow(-) => :value\n        )\n    end\n\n\n    demand = data(loads) * mapping(\n        :DateTime, :value, color = :Source, layout = :REGIONID\n    ) * visual(Lines, linestyle = (:dash, :dense))\n    generation = data(by_fuel) * mapping(\n        :DateTime, :value, color = :Source, layout = :REGIONID\n    ) * visual(Lines)\n\n    draw(\n        demand + generation;\n        figure = (; size = (1000, 400)),\n        legend = (; position = :bottom)\n    )\nend\n\n<img width=1000 height=400 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>\n\nLet's observe the dispatch of a few thermal generators\n\nbegin\n    thermals_non_zero = thermal[:, filter(x -> (x == \"DateTime\" || any(thermal[!, x] .> 0)), names(thermal))]\n    sample = select(thermals_non_zero, 1:6)\n    cols = names(select(sample, Not(:DateTime)))\n    data(sample) * mapping(:DateTime, cols, color = dims(1)) * visual(Lines) |> draw\nend\n\n<img width=600 height=450 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>\n\nLet's observe the dispatch of a few renewable generators\n\nbegin\n    renewables_non_zero = renewables[:, filter(x -> (x == \"DateTime\" || any(renewables[!, x] .> 0)), names(renewables))]\n    sample = select(renewables_non_zero, 1:6)\n    cols = names(select(sample, Not(:DateTime)))\n    data(sample) * mapping(:DateTime, cols, color = dims(1)) * visual(Lines) |> draw\nend\n\n<img width=600 height=450 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>\n\n\n\nThis page was generated using Literate.jl.","category":"section"},{"location":"#AustralianElectricityMarkets.jl","page":"Home","title":"AustralianElectricityMarkets.jl","text":"(Image: Stable) (Image: Dev) (Image: Build Status) (Image: code style: runic)\n\nA Julia package for interfacing with the Australian Energy Market Operator (AEMO) data archive.","category":"section"},{"location":"#Description","page":"Home","title":"Description","text":"This package provides a set of tools to fetch, cache, and process data from AEMO's public data sources, particularly through the NEMWEB data archive. It allows users to read various datasets, and integrates with PowerSystems.jl for power system modeling and simulation.","category":"section"},{"location":"#Installation","page":"Home","title":"Installation","text":"To install the package, open the Julia REPL and run:\n\nusing Pkg\nPkg.add(\"AustralianElectricityMarkets\")","category":"section"},{"location":"#Usage","page":"Home","title":"Usage","text":"Here is a basic example of how to use the package to read demand data:\n\nusing AustralianElectricityMarkets\nusing TidierDB\n\n# Establish a database connection\ndb = connect(duckdb());\n\n# Download the data from the monthly archive, saving them locally\n# in parquet files\n# Only the data requirements for a RegionalNetworkconfiguration are downloaded.\ndate_range = Date(2025, 1, 1):Date(2025, 1, 2)\nfetch_table_data(date_range, RegionalNetworkConfiguration())\n\ndemand_df = read_demand(db)\nprintln(demand_df)\n\nAnd parsing the data into PowerSystems.jl\n\n# Instantiate a System\nsys = nem_system(db, RegionalNetworkConfiguration())\n\nprintln(demand_df)","category":"section"},{"location":"#Features","page":"Home","title":"Features","text":"Data Fetching: Fetch data from AEMO's NEMWEB data source for specified time ranges.\nData Processing: Read and process various NEMDB tables, including:\nInterconnector data\nRegional demand\nGeneration unit details\nPowerSystems.jl Integration: Parse AEMO data into PowerSystems.jl models for simulation.","category":"section"},{"location":"#Data-Sources","page":"Home","title":"Data Sources","text":"This package primarily interfaces with data from the Australian Energy Market Operator (AEMO). It relies on the NEMWEB data archives and data models.","category":"section"},{"location":"#License","page":"Home","title":"License","text":"This project is licensed under the MIT License.","category":"section"},{"location":"#Index","page":"Home","title":"Index","text":"","category":"section"},{"location":"#AustralianElectricityMarkets.HiveConfiguration","page":"Home","title":"AustralianElectricityMarkets.HiveConfiguration","text":"HiveConfiguration\n\nConfiguration for accessing data.\n\nFields\n\nhive_location::String: The directory where data is cached. Defaults to ~/.nemweb_cache.\nfilesystem::String: The filesystem to use for the cache. Defaults to \"local\". Can be s3, gs.\n\n\n\n\n\n","category":"type"},{"location":"#AustralianElectricityMarkets._add_demand_ts_to_components!-Tuple{Any, Any, Any}","page":"Home","title":"AustralianElectricityMarkets._add_demand_ts_to_components!","text":"_add_demand_ts_to_components!(sys, ts, type)\n\nAdds demand time series data to the system components.\n\nArguments\n\nsys: The PowerSystems.System object.\nts: A TimeArray of demand data.\ntype: The type of component to add the time series to.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets._add_renewable_ts_to_components!-Tuple{Any, Any, Any}","page":"Home","title":"AustralianElectricityMarkets._add_renewable_ts_to_components!","text":"_add_renewable_ts_to_components!(sys, ts, prime_mover)\n\nAdds renewable generation time series data to the system components.\n\nArguments\n\nsys: The PowerSystems.System object.\nts: A TimeArray of renewable generation data.\nprime_mover: The prime mover type of the renewable generator.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets._as_timearray-NTuple{4, Any}","page":"Home","title":"AustralianElectricityMarkets._as_timearray","text":"_as_timearray(df, index, col, value)\n\nConverts a DataFrame to a TimeArray.\n\nArguments\n\ndf: The input DataFrame.\nindex: The column to use as the timestamp.\ncol: The column to use for the column names of the TimeArray.\nvalue: The column to use for the values of the TimeArray.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets._filter_latest-Tuple{Any, Any}","page":"Home","title":"AustralianElectricityMarkets._filter_latest","text":"_filter_latest(table, key)\n\nHelper function to filter for the most recent records in a table based on a given key.\n\nArguments\n\ntable: The TidierDB table to filter.\nkey: The column (as a Symbol) to use for determining the latest records.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets._filter_latest-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets._filter_latest","text":"_filter_latest(table, key=:archive_month)\n\nHelper function to filter for the most recent records in a table.\n\nArguments\n\ntable: The table to filter.\nkey: The column to use for determining the latest records. Defaults to :archive_month.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets._parse_hive_root-Tuple{HiveConfiguration}","page":"Home","title":"AustralianElectricityMarkets._parse_hive_root","text":"_parse_hive_root(config::PyHiveConfiguration)\n\nConstruct the correct path to the Hive dataset based on the specified filesystem.\n\nArguments\n\nconfig::PyHiveConfiguration: The configuration object containing filesystem and location details.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.fetch_table_data-Tuple{Symbol, Any}","page":"Home","title":"AustralianElectricityMarkets.fetch_table_data","text":"fetch_table_data(table::Symbol, time_range; config::HiveConfiguration=CONFIG[])\n\nFetches data for a specified table over a given time range and populates the local cache.\n\nIt iterates through the months in the time_range and calls populate for each month to download and cache the data.\n\nArguments\n\ntable::Symbol: The name of the table to fetch data for (e.g., :DISPATCHREGIONSUM).\ntime_range: A range of dates (e.g., Date(2023, 1):Month(1):Date(2023, 3)).\nconfig::HiveConfiguration: The configuration to use. Defaults to CONFIG[].\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.get_data_url-Tuple{String, Int64, Int64}","page":"Home","title":"AustralianElectricityMarkets.get_data_url","text":"get_data_url(data::String, year::Int, month::Int)\n\nConstructs the URL(s) for downloading a specific AEMO NEMWEB dataset for a given year and month.\n\nIt scrapes the NEMWEB data archive page to find the correct link(s) to the zipped data file(s).\n\nArguments\n\ndata::String: The name of the dataset table (e.g., \"DISPATCHREGIONSUM\").\nyear::Int: The year of the data.\nmonth::Int: The month of the data.\n\nReturns\n\nVector{String}: A vector of full URL strings for the requested data files. Throws an error if no files are found.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.populate-Tuple{Symbol, Integer, Integer}","page":"Home","title":"AustralianElectricityMarkets.populate","text":"populate(key::Symbol, year::Integer, month::Integer; config::HiveConfiguration=CONFIG[])\n\nDownloads and caches a month of data for a given table from the AEMO NEMWEB data source.\n\nIf the data for the specified month and table already exists in the local cache, it does nothing.  Otherwise, it constructs the URL, downloads the zipped CSV data, reads it, and writes it to the  local hive-partitioned parquet cache.\n\nArguments\n\nkey::Symbol: The name of the table to populate (e.g., :DISPATCHREGIONSUM).\nyear::Integer: The year of the data to fetch.\nmonth::Integer: The month of the data to fetch.\nconfig::HiveConfiguration: The configuration to use. Defaults to CONFIG[].\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.read_demand-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.read_demand","text":"read_demand(db; resolution::Dates.Period=Dates.Minute(5))\n\nRead and process regional demand data from the database.\n\nArguments\n\ndb: The database connection.\nresolution::Dates.Period: The time resolution to which the data should be floored. Defaults to 5 minutes.\n\nReturns\n\nA DataFrame with demand and renewable availability data, aggregated by the specified resolution.\n\nExample\n\ndb = connect(duckdb())\ndemand_df = read_demand(db; resolution=Dates.Hour(1))\nprintln(demand_df)\n\nRow  SETTLEMENTDATE       REGIONID  TOTALDEMAND  DISPATCHABLEGENERATION  DISPATCHABLELOAD  NETINTERCHANGE  \t    Dates.DateTime       String7   Float64      Float64                 Float64           Float64          \t 1  2024-01-01T00:05:00  NSW1          6574.92                 6721.88               0.0          146.96 \t 2  2024-01-01T00:05:00  QLD1          6228.31                 5713.21               0.0         -515.1 \t 3  2024-01-01T00:05:00  SA1           1293.98                 1116.68               0.0         -177.3 \t 4  2024-01-01T00:05:00  TAS1          1033.29                  580.29               0.0         -453.0 \t 5  2024-01-01T00:05:00  VIC1          3977.1                  5071.17               0.0         1094.07\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.read_hive-Tuple{DBInterface.Connection, Symbol}","page":"Home","title":"AustralianElectricityMarkets.read_hive","text":"read_hive(db::TidierDB.DBInterface.Connection,table_name::Symbol; config::HiveConfiguration=CONFIG[])\n\nRead a hive-partitioned parquet dataset into a TidierDB table.\n\nArguments\n\ndb::TidierDB.DBInterface.Connection: The database connection to use.\ntable_name::Symbol: The name of the table to read.\nconfig::HiveConfiguration: The configuration to use. Defaults to CONFIG[].\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.read_interconnectors-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.read_interconnectors","text":"read_interconnectors(db)\n\nReads and processes interconnector data from the database.\n\nArguments\n\ndb: The database connection.\n\nReturns\n\nA DataFrame containing the latest interconnector constraint data.\n\nExample\n\ndb = connect(duckdb())\ninterconnectors_df = read_interconnectors(db)\nprintln(interconnectors_df)\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.read_units-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.read_units","text":"read_units(db)\n\nGathers and processes unit data from the database.\n\nArguments\n\ndb: The database connection.\n\nReturns\n\nA DataFrame containing detailed information about each generation unit.\n\nExample\n\ndb = connect(duckdb())\nunits_df = read_units(db)\nprintln(units_df)\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.read_zip_csv-Tuple{String}","page":"Home","title":"AustralianElectricityMarkets.read_zip_csv","text":"read_zip_csv(path::String; select::Union{Nothing, Vector{Symbol}}=nothing)::DataFrame\n\nReads the first CSV file from a zip archive into a DataFrame.\n\nThis function is designed to handle the specific format of AEMO's zipped data files,  which often contain a header section. It skips the initial metadata lines and only reads  the data rows, identified by a value of \"D\" in the 'I' column, which is then dropped.\n\nArguments\n\npath::String: The file path to the zip archive.\nselect::Union{Nothing, Vector{Symbol}}: An optional vector of column names (as Symbols) to select from the CSV file. If nothing, all columns are read.\n\nReturns\n\nDataFrame: A DataFrame containing the data from the CSV file.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.set_demand!-Tuple{Any, Any, Any}","page":"Home","title":"AustralianElectricityMarkets.set_demand!","text":"set_demand!(sys, db, date_range; kwargs...)\n\nAdds load time series data to the system from the database.\n\nThis function reads demand data for a specified date range, processes it into a time series, and attaches it to the PowerLoad components in the system.\n\nArguments\n\nsys: The PowerSystems.System object.\ndb: The database connection.\ndate_range: A range of dates for which to fetch demand data.\nkwargs: Additional keyword arguments passed to read_demand.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.set_renewable_pv!-Tuple{Any, Any, Any}","page":"Home","title":"AustralianElectricityMarkets.set_renewable_pv!","text":"set_renewable_pv!(sys, db, date_range; kwargs...)\n\nAdds photovoltaic (PV) renewable generation time series data to the system.\n\nThis function reads solar availability data for a specified date range from the database, processes it into a time series, and attaches it to the RenewableDispatch components representing PV generators.\n\nArguments\n\nsys: The PowerSystems.System object.\ndb: The database connection.\ndate_range: A range of dates for which to fetch the data.\nkwargs: Additional keyword arguments passed to read_demand.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.set_renewable_wind!-Tuple{Any, Any, Any}","page":"Home","title":"AustralianElectricityMarkets.set_renewable_wind!","text":"set_renewable_wind!(sys, db, date_range; kwargs...)\n\nAdds wind turbine renewable generation time series data to the system.\n\nThis function reads wind availability data for a specified date range from the database, processes it into a time series, and attaches it to the RenewableDispatch components representing wind turbines.\n\nArguments\n\nsys: The PowerSystems.System object.\ndb: The database connection.\ndate_range: A range of dates for which to fetch the data.\nkwargs: Additional keyword arguments passed to read_demand.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel.RegionalNetworkConfiguration","page":"Home","title":"AustralianElectricityMarkets.RegionModel.RegionalNetworkConfiguration","text":"Each australian State (i.e. AEMO Region) is a combination of a load node and a generator node. The load nodes are connected.\nbetween states by interconnectors\n\n\n\n\n\n","category":"type"},{"location":"#AustralianElectricityMarkets.RegionModel._add_branches!-Tuple{Any, Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel._add_branches!","text":"_add_branches!(sys, branch_df)\n\nAdds branches to the system.\n\nArguments\n\nsys: The PowerSystems.System object.\nbranch_df: A DataFrame of branch data.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel._add_buses!-Tuple{Any, Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel._add_buses!","text":"_add_buses!(sys, bus_df)\n\nAdds buses to the system.\n\nArguments\n\nsys: The PowerSystems.System object.\nbus_df: A DataFrame of bus data.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel._add_generation!-Tuple{Any, Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel._add_generation!","text":"_add_generation!(sys, gen_df)\n\nAdds generation units to the system.\n\nArguments\n\nsys: The PowerSystems.System object.\ngen_df: A DataFrame of generator data.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel._add_loads!-Tuple{Any, Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel._add_loads!","text":"_add_loads!(sys, loads_df)\n\nAdds loads to the system.\n\nArguments\n\nsys: The PowerSystems.System object.\nloads_df: A DataFrame of load data.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel.fetch_table_data-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel.fetch_table_data","text":"fetch_table_data(time_range; kwargs...)\n\nFetches data for a predefined list of tables over a given time range.\n\nArguments\n\ntime_range: The time range for which to fetch data.\nkwargs: Additional keyword arguments to be passed to the data fetching function.\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel.get_branch_dataframe-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel.get_branch_dataframe","text":"get_branch_dataframe(db)\n\nGenerates a DataFrame of branch information.\n\nArguments\n\ndb: The database connection.\n\nReturns\n\nA DataFrame containing branch details.\n\nExample\n\ndb = connect(duckdb())\nbranch_df = get_branch_dataframe(db)\nprintln(branch_df)\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel.get_bus_dataframe-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel.get_bus_dataframe","text":"get_bus_dataframe(db)\n\nGenerates a DataFrame of bus information.\n\nArguments\n\ndb: The database connection.\n\nReturns\n\nA DataFrame containing bus details.\n\nExample\n\ndb = connect(duckdb())\nbus_df = get_bus_dataframe(db)\nprintln(bus_df)\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel.get_generators_dataframe-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel.get_generators_dataframe","text":"get_generators_dataframe(db)\n\nGenerates a DataFrame of generator information.\n\nArguments\n\ndb: The database connection.\n\nReturns\n\nA DataFrame containing generator details.\n\nExample\n\ndb = connect(duckdb())\ngen_df = get_generators_dataframe(db)\nprintln(gen_df)\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel.get_load_dataframe-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel.get_load_dataframe","text":"get_load_dataframe(db)\n\nGenerates a DataFrame of load information.\n\nArguments\n\ndb: The database connection.\n\nReturns\n\nA DataFrame containing load details.\n\nExample\n\ndb = connect(duckdb())\nload_df = get_load_dataframe(db)\nprintln(load_df)\n\n\n\n\n\n","category":"method"},{"location":"#AustralianElectricityMarkets.RegionModel.nem_system-Tuple{Any}","page":"Home","title":"AustralianElectricityMarkets.RegionModel.nem_system","text":"nem_system(db)\n\nAssembles a PowerSystems.System object from the database.\n\nArguments\n\ndb: The database connection.\n\nReturns\n\nA PowerSystems.System object.\n\nExample\n\ndb = connect(duckdb())\nsys = nem_system(db)\nprintln(sys)\n\n\n\n\n\n","category":"method"},{"location":"examples/build_system/#Overview-of-the-NEM","page":"Explore the NEM","title":"Overview of the NEM","text":"The National Electricity Market (NEM) operates on one of the worlds longest interconnected power systems. It covers around 40,000 km of transmission lines and cables, supplying a population exceeding 23 million.\n\nThe NEM also","category":"section"},{"location":"examples/build_system/#Simple-usage","page":"Explore the NEM","title":"Simple usage","text":"This package handles the download of data from the NEMWEB Archive and the parsing of the data into a System from PowerSystems.jl. At the moment only a simple zonal network model is available (a nodal model with physical lines is a work-in-progress), which allows to model a simple economic dispatch. By default, the package will create a hidden folder .aem_cache in the home directory, and save the data into parquet files.\n\nbegin\n    using AustralianElectricityMarkets\n    using TidierDB\n    using Dates\n    using PowerSystems\n    using DataFrames\n    using Chain\n    using CairoMakie, AlgebraOfGraphics\nend\n\n\n# Initialise a connection to manage the market data via duckdb\ndb = connect(duckdb());\n\n# Download data from AEMO's NEMWEB's Monthly archive\ndate_range = Date(2025, 1, 1):Date(2025, 1, 2)\n\n# Download the data from the monthly archive, saving them locally\n# in parquet files.\n# Only the data requirements for a RegionalNetworkconfiguration are downloaded.\nfetch_table_data(date_range, RegionalNetworkConfiguration());\n\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23INTERCONNECTOR%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 10 columns around data row: 9. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23INTERCONNECTORCONSTRAINT%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 26 columns around data row: 226. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23DISPATCHREGIONSUM%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 129 columns around data row: 44641. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23DUDETAIL%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 38 columns around data row: 4279. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23DUDETAILSUMMARY%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 33 columns around data row: 13295. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23STATION%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 15 columns around data row: 588. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23STATIONOPERATINGSTATUS%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 11 columns around data row: 1382. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23GENUNITS%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 26 columns around data row: 913. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n[ Info: Downloading file from https://nemweb.com.au/Data_Archive/Wholesale_Electricity/MMSDM/2025/MMSDM_2025_01/MMSDM_Historical_Data_SQLLoader/DATA/PUBLIC_ARCHIVE%23DUALLOC%23FILE01%23202501010000.zip\n Warning: thread = 1 warning: only found 3 / 9 columns around data row: 2997. Filling remaining columns with `missing`\n @ CSV ~/.julia/packages/CSV/XLcqT/src/file.jl:592\n\n\nOnce the data is downloaded, a few utility functions allow direct parsing of key quantities, such as a table of all units registered in the NEM, or the region zonal operational demand\n\n# read all units\nunits = read_units(db)\n\ncapacity_by_fuel = @chain units begin\n    select(:DUID, :REGISTEREDCAPACITY, :CO2E_ENERGY_SOURCE, :REGIONID)\n    groupby([:CO2E_ENERGY_SOURCE, :REGIONID])\n    combine(:REGISTEREDCAPACITY => (x -> sum(x) / 1000) => :installed_capacity_gw)\n    dropmissing\n    sort!(:installed_capacity_gw)\n    # Ignore marginal sources\n    subset!(:installed_capacity_gw => ByRow(>=(0.1)))\nend\n\nspec = mapping(\n    :REGIONID,\n    :installed_capacity_gw => \"Installed capacity [GW]\",\n    stack = :CO2E_ENERGY_SOURCE,\n    color = :CO2E_ENERGY_SOURCE => \"Fuel source\"\n) * visual(\n    BarPlot, alpha = 0.8,\n)\nfig = data(capacity_by_fuel) * spec\ndraw(\n    fig,\n    figure = (;\n        title = \"Installed capacity in the National Electricity Market by energy source\",\n    ),\n    scales(Color = (; palette = from_continuous(:Paired_12)))\n)\n\n<img width=600 height=450 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>\n\nRead the demand for each state\n\ndemand = read_demand(db)\n\nbegin\n    spec = data(\n        subset(demand, :SETTLEMENTDATE => ByRow(x -> (Date(2025, 1, 20) <= x <= Date(2025, 1, 31))))\n    )\n    spec *= mapping(:SETTLEMENTDATE => \"Date\", :TOTALDEMAND => \"Total Demand [MW]\", color = :REGIONID => \"State\")\n    spec *= visual(Lines)\n    figure_options = (;\n        title = \"Regional demand in each Australian state\",\n        subtitle = \"Period of January 20th 2025 to January 31st 2025\",\n    )\n    draw(spec; figure = figure_options)\nend\n\n<img width=600 height=450 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>\n\nAustralia has a fairly high penetration of PV, which at times exceed a state's total demand for electricity (in SA in particular)\n\nbegin\n    spec = data(\n        subset(demand, :SETTLEMENTDATE => ByRow(x -> (Date(2025, 1, 20) <= x <= Date(2025, 1, 31))))\n    )\n    spec *= mapping(:SETTLEMENTDATE => \"Date\", :SS_SOLAR_AVAILABILITY => \"Total Demand [MW]\", color = :REGIONID => \"State\")\n    spec *= visual(Lines)\n    figure_options = (;\n        title = \"Solar generation from semi-scheduled units per state\",\n        subtitle = \"Period of January 20th  2025 to January 31st 2025\",\n    )\n    draw(spec; figure = figure_options)\nend\n\n<img width=600 height=450 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>","category":"section"},{"location":"examples/build_system/#Integration-with-PowerSystems.jl","page":"Explore the NEM","title":"Integration with PowerSystems.jl","text":"The main purpose of this package is to provide the data required for instantiating systems with PowerSystems.jl and leverage the ecosystem of power systems modelling developed by NREL-Sienna.\n\n# Instantiate the system\nsys = nem_system(db, RegionalNetworkConfiguration())\n\n<table>\n  <caption style = \"text-align: left;\">System</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Property</th>\n      <th style = \"text-align: left;\">Value</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">Name</td>\n      <td style = \"text-align: left;\"></td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Description</td>\n      <td style = \"text-align: left;\"></td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">System Units Base</td>\n      <td style = \"text-align: left;\">SYSTEM_BASE</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Base Power</td>\n      <td style = \"text-align: left;\">100.0</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Base Frequency</td>\n      <td style = \"text-align: left;\">60.0</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Num Components</td>\n      <td style = \"text-align: left;\">471</td>\n    </tr>\n  </tbody>\n</table>\n\n<table>\n  <caption style = \"text-align: left;\">Static Components</caption>\n  <thead>\n    <tr class = \"header headerLastRow\">\n      <th style = \"text-align: left;\">Type</th>\n      <th style = \"text-align: left;\">Count</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td style = \"text-align: left;\">ACBus</td>\n      <td style = \"text-align: left;\">12</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Arc</td>\n      <td style = \"text-align: left;\">12</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Area</td>\n      <td style = \"text-align: left;\">6</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">Line</td>\n      <td style = \"text-align: left;\">14</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">PowerLoad</td>\n      <td style = \"text-align: left;\">6</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">RenewableDispatch</td>\n      <td style = \"text-align: left;\">222</td>\n    </tr>\n    <tr>\n      <td style = \"text-align: left;\">ThermalStandard</td>\n      <td style = \"text-align: left;\">199</td>\n    </tr>\n  </tbody>\n</table>\n\n\n\nUsers can then interact with the system with all PowerSystems utilities\n\n# Explore the thermal generators\nthermal = @chain get_components(ThermalGen, sys) |> DataFrame begin\n    select!([:name, :fuel, :prime_mover_type, :base_power])\n    groupby(:fuel)\n    combine(:base_power => sum => :installed_capacity_mw)\nend\n\n<div><div style = \"float: left;\"><span>52 DataFrame</span></div><div style = \"clear: both;\"></div></div><div class = \"data-frame\" style = \"overflow-x: scroll;\"><table class = \"data-frame\" style = \"margin-bottom: 6px;\"><thead><tr class = \"header\"><th class = \"rowNumber\" style = \"font-weight: bold; text-align: right;\">Row</th><th style = \"text-align: left;\">fuel</th><th style = \"text-align: left;\">installed_capacity_mw</th></tr><tr class = \"subheader headerLastRow\"><th class = \"rowNumber\" style = \"font-weight: bold; text-align: right;\"></th><th title = \"PowerSystems.ThermalFuelsModule.ThermalFuels\" style = \"text-align: left;\">ThermalF</th><th title = \"Float64\" style = \"text-align: left;\">Float64</th></tr></thead><tbody><tr><td class = \"rowNumber\" style = \"font-weight: bold; text-align: right;\">1</td><td style = \"text-align: left;\">PowerSystems.ThermalFuelsModule.ThermalFuels.NATURAL_GAS = 7</td><td style = \"text-align: right;\">9710.0</td></tr><tr><td class = \"rowNumber\" style = \"font-weight: bold; text-align: right;\">2</td><td style = \"text-align: left;\">PowerSystems.ThermalFuelsModule.ThermalFuels.COAL = 1</td><td style = \"text-align: right;\">21371.0</td></tr><tr><td class = \"rowNumber\" style = \"font-weight: bold; text-align: right;\">3</td><td style = \"text-align: left;\">PowerSystems.ThermalFuelsModule.ThermalFuels.OTHER_GAS = 8</td><td style = \"text-align: right;\">1329.0</td></tr><tr><td class = \"rowNumber\" style = \"font-weight: bold; text-align: right;\">4</td><td style = \"text-align: left;\">PowerSystems.ThermalFuelsModule.ThermalFuels.AG_BIPRODUCT = 10</td><td style = \"text-align: right;\">480.0</td></tr><tr><td class = \"rowNumber\" style = \"font-weight: bold; text-align: right;\">5</td><td style = \"text-align: left;\">PowerSystems.ThermalFuelsModule.ThermalFuels.DISTILLATE_FUEL_OIL = 3</td><td style = \"text-align: right;\">841.0</td></tr></tbody></table></div>\n\nGet informations for a specific unit\n\ngen = get_components_by_name(ThermalGen, sys, \"JLA02\") |> first\n\nThermalStandard: JLA02:\n   name: JLA02\n   available: true\n   status: true\n   bus: ACBus: VIC1_GEN_BUS\n   active_power: 0.0\n   reactive_power: 0.0\n   rating: 0.51\n   active_power_limits: (min = 0.0, max = 0.65)\n   reactive_power_limits: nothing\n   ramp_limits: (up = 0.23, down = 0.23)\n   operation_cost: PowerSystems.ThermalGenerationCost composed of variable: InfrastructureSystems.FuelCurve{InfrastructureSystems.LinearCurve}\n   base_power: 51.0\n   time_limits: (up = 8.0, down = 8.0)\n   must_run: false\n   prime_mover_type: PowerSystems.PrimeMoversModule.PrimeMovers.CC = 4\n   fuel: PowerSystems.ThermalFuelsModule.ThermalFuels.NATURAL_GAS = 7\n   services: 0-element Vector{PowerSystems.Service}\n   time_at_status: 10000.0\n   dynamic_injector: nothing\n   ext: Dict{String, Any}(\"postcode\" => \"3000\", \"station_name\" => \"Jeeralang \\\"A\\\" Power Station\", \"station_id\" => \"JEERA\")\n   InfrastructureSystems.SystemUnitsSettings:\n      base_value: 100.0\n      unit_system: InfrastructureSystems.UnitSystemModule.UnitSystem.SYSTEM_BASE = 0\n   has_supplemental_attributes: false\n   has_time_series: false\n\nCheck the prime mover type\n\nget_prime_mover_type(gen)\n\nPowerSystems.PrimeMoversModule.PrimeMovers.CC = 4\n\nCheck the rating in natural units\n\nwith_units_base(sys, \"NATURAL_UNITS\") do\n    get_rating(gen)\nend\n\n51.0\n\n\n\nThis page was generated using Literate.jl.","category":"section"}]
